import React from 'react';
import Tilt from 'react-tilt';
import brain from './brain.png.png';
import './Logo.css';

const Logo = () =>
{
	return(
		<div className = 'ma4 mt0'>
		<Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 200, width: 250 }} >
 		<div className="Tilt-inner"> <img alt="Logo" src = {brain}/> </div>
		</Tilt>
		</div>
		);
}

export default Logo;
